import WelcomeNavbar from "../WelcomeNavbar/WelcomeNavbar";
const SignupForm = () => {
	return (
		<div className={Styles.container}>
			<WelcomeNavbar></WelcomeNavbar>
			<h1>Welcome page</h1>
		</div>
	);
};
export default SignupForm;
